import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Box from '@material-ui/core/Box';
import Grid from '@material-ui/core/Grid';
import Avatar from '@material-ui/core/Avatar';
import headshot from '../static/headshot.jpg'
import { Hidden } from '@material-ui/core';

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  paper: {
    padding: theme.spacing(1),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
  person: {
    height: theme.spacing(30), 
    width: theme.spacing(30)
  },

}));

export default function TeamPage() {
  const classes = useStyles();

  return (
    <div className={classes.root}>
    <h1>Our Team</h1>
    <Grid container spacing={0} wrap="nowrap">
      <Grid item xs={2.4}>
        <Box className={classes.paper}>
        <Avatar className={classes.person} alt="Sam Levy" src={headshot} />
          <span style={{textAlign: "center"}}>Samuel Levy</span>
          <p>Hello, my name is sam and I am here to say hello! What is happening with you? There is not a lot happening with me</p>
        </Box>
      </Grid>
      <Grid item xs={2.4}>
        <Box className={classes.paper}>
        <Avatar className={classes.person} alt="Sam Levy" src={headshot} />
          <p>Hello, my name is sam and I am here to say hello! What is happening with you? There is not a lot happening with me</p>
        </Box>
      </Grid>
      <Grid item xs={2.4}>
        <Box className={classes.paper}>
        <Avatar className={classes.person} alt="Sam Levy" src={headshot} />
          <p>Hello, my name I am jessica</p>
        </Box>
      </Grid>
      <Grid item xs={2.4}>
        <Box className={classes.paper}>
        <Avatar className={classes.person} alt="Sam Levy" src={headshot} />
          <p>Hello, my name is sam and I am here to say hello! What is happening with you? There is not a lot happening with me</p>
        </Box>
      </Grid>
      <Grid item xs={2.4}>
        <Box className={classes.paper}>
        <Avatar className={classes.person} alt="Sam Levy" src={headshot} />
          <p>Hello, my name is sam and I am here to say hello! What is happening with you? There is not a lot happening with me</p>
        </Box>
      </Grid>
    </Grid>
  </div>
    );
}
